import React from "react"

class Home extends React.Component{
    render(){
        return(
            <section id="first" className="main">
				<div className="container">
                    <div className="row">
                        <div className="col-8">
                            <h2>We combine <span>bold creativity with <br/> superior technology</span>
                                to deliver <br/> outstanding digital solutions.</h2>
                        </div>
                    </div>
                </div>
			</section>
        )
    }
}








export default Home
